import React from "react";
import { Navbar, Button } from "flowbite-react";
import { Link } from "react-router-dom";

const Navigation = () => {
    return (
        <div>
            <Navbar className="container mx-auto py-6" fluid={true} rounded={true}>
                <Navbar.Brand href="/">
                    <span className="self-center whitespace-nowrap text-2xl font-bold ">
                        LOKAK.<span className="text-primary hover:decoration-wavy">GAWE</span>
                    </span>
                </Navbar.Brand>
                <div className="flex md:order-2">
                    {/* <Button>Get started</Button> */}
                    <button className="bg-primary hover:bg-white text-quaternary hover:text-primary py-2 px-4 text-sm font-semibold rounded-md border-2 border-primary ease-in-out transition duration-700">Login</button>
                    <Navbar.Toggle />
                </div>
                <Navbar.Collapse>
                    <li className="mx-auto sm:m-0 my-2 border-b-2 sm:border-none hover:text-primary ">
                        <Link to="/" className="text-dark font-semibold hover:text-primary ">
                            Home
                        </Link>
                    </li>
                    <li className="mx-auto sm:m-0 my-2 border-b-2 sm:border-none hover:text-primary ">
                        <Link to="/job-vacancy" className="text-dark font-semibold hover:text-primary ">
                            Job Vacancy
                        </Link>
                    </li>
                </Navbar.Collapse>
            </Navbar>
        </div>
    );
};

export default Navigation;
